import axios from 'axios'
const baseURL = 'http://localhost:3000'

const SERVICE = axios.create({ withCredentials: true, baseURL })

const DATE_SERVICE = {
  post: async user => {
    return await SERVICE.post('/api/pedidos', )
  },
}

export default DATE_SERVICE
